css:
@-webkit-keyframes instant-build-spinner {
  0% {
    -webkit-transform: scale(0);
  }
  100% {
    -webkit-transform: scale(1);
    opacity: 0;
  }
}
.instant-build-progress-bar {
  position: absolute;
  background-color: #6494ed;
  width: 0px;
  height: 2px;
  opacity: 0;
}
.instant-build-spinner {
  display: inline-block;
  width: 12px;
  height: 12px;
  margin: 0 5px 0 0;
  background-color: #6494ed;
  vertical-align: text-top;
  border-radius: 100%;
  -webkit-animation: instant-build-spinner 1s infinite ease-in-out;
}
.instant-build-status {
  display: inline-block;
  width: 100px;
  margin-right: 5px;
  margin-left: -100px;
  -webkit-transition: margin-left 0.3s ease, opacity 0.3s ease;
}
.instant-build-status.bb-visible {
  opacity: 1;
  margin-left: 0;
}
.instant-build-status.bb-hidden {
  opacity: 0;
  margin-left: -100px;
}
.instant-build-status.building {
  color: #6494ed;
}
.instant-build-status.success {
  color: #73c990;
}
.instant-build-status.error {
  color: #ff6347;
}
